    async shareMyQr(pdfBase64) {
        try {
            //console.log('FileName B64 : ', pdfBase64);
            let datetime = moment(new Date()).format("YYYYMMDD_HHmmss");
            let fileName = "MAE_QR_" + datetime + ".pdf";
            console.log("FileName : ", fileName);
            let filePath = "";
            if (Platform.OS == "ios") {
                filePath = RNFetchBlob.fs.dirs.DocumentDir + "/" + fileName;
            } else {
                filePath = RNFetchBlob.fs.dirs.DownloadDir + "/" + fileName;
            }
            console.log("FilePath : ", filePath);
            RNFetchBlob.fs
                .writeFile(filePath, pdfBase64, "base64")
                .then((response) => {
                    console.log("Success Log: ", response);
                })
                .catch((errors) => {
                    console.log(" Error Log: ", errors);
                });

            const shareOptions = {
                title: "My MAE QR",
                message: "Share MAE QR",
                mimeType: "application/pdf",
                url: "file://" + filePath,
                subject: "MAE QR",
            };

            const sh = await Share.open(shareOptions).catch((err) => {
                console.log("Share Err", err);
            });
            //RNFetchBlob.fs.unlink(filePath);
        } catch (e) {
            console.log("Err", e);
        }
    }

