    async shareReceipt(pdfBase64) {
        try {
            let datetime = moment(new Date()).format("YYYYMMDD_HHmmss");
            let fileName = "MayaReceipt_" + datetime + ".pdf";
            console.log("FileName : ", fileName);
            let filePath = "";
            if (Platform.OS == "ios") {
                filePath = RNFetchBlob.fs.dirs.DocumentDir + "/" + fileName;
            } else {
                filePath = RNFetchBlob.fs.dirs.DownloadDir + "/" + fileName;
            }
            console.log("FilePath : ", filePath);
            RNFetchBlob.fs
                .writeFile(filePath, pdfBase64, "base64")
                .then((response) => {
                    console.log("Success Log: ", response);
                })
                .catch((errors) => {
                    console.log(" Error Log: ", errors);
                });

            const shareOptions = {
                title: "MAYA Receipt",
                message: "Share MAYAReceipt",
                url: "file://" + filePath,
                subject: "MAYA Receipt",
            };
            const sh = await Share.open(shareOptions).catch((err) => {
                console.log(err);
            });
        } catch (e) {
            console.log(e);
        }
    }

